package vo;

public class MemberVo {
	
	int		m_idx;
	String	m_id;
	String	m_pwd;
	String	m_nick;
	String	m_email;
	String	m_ph;
	String	m_date;
	String	m_ip;
	String	m_jumin;
	String	m_pref_book;
	int		m_age;
	String	m_name;
	String	m_zipcode;
	String	m_addr;
	String	m_grade;
	
	//扁夯 积己磊 积己
	public MemberVo() {
		// TODO Auto-generated constructor stub
	}

	public MemberVo(String m_id, String m_pwd, String m_nick, String m_email, String m_ph, String m_ip, String m_jumin,
			String m_pref_book, int m_age, String m_name, String m_zipcode, String m_addr,
			String m_grade) {
		super();
		this.m_id = m_id;
		this.m_pwd = m_pwd;
		this.m_nick = m_nick;
		this.m_email = m_email;
		this.m_ph = m_ph;
		this.m_ip = m_ip;
		this.m_jumin = m_jumin;
		this.m_pref_book = m_pref_book;
		this.m_age = m_age;
		this.m_name = m_name;
		this.m_zipcode = m_zipcode;
		this.m_addr = m_addr;
		this.m_grade = m_grade;
	}

	public int getM_idx() {
		return m_idx;
	}

	public void setM_idx(int m_idx) {
		this.m_idx = m_idx;
	}

	public String getM_id() {
		return m_id;
	}

	public void setM_id(String m_id) {
		this.m_id = m_id;
	}

	public String getM_pwd() {
		return m_pwd;
	}

	public void setM_pwd(String m_pwd) {
		this.m_pwd = m_pwd;
	}

	public String getM_nick() {
		return m_nick;
	}

	public void setM_nick(String m_nick) {
		this.m_nick = m_nick;
	}

	public String getM_email() {
		return m_email;
	}

	public void setM_email(String m_email) {
		this.m_email = m_email;
	}

	public String getM_ph() {
		return m_ph;
	}

	public void setM_ph(String m_ph) {
		this.m_ph = m_ph;
	}

	public String getM_date() {
		return m_date;
	}

	public void setM_date(String m_date) {
		this.m_date = m_date;
	}

	public String getM_ip() {
		return m_ip;
	}

	public void setM_ip(String m_ip) {
		this.m_ip = m_ip;
	}

	public String getM_jumin() {
		return m_jumin;
	}

	public void setM_jumin(String m_jumin) {
		this.m_jumin = m_jumin;
	}

	
	public String getM_pref_book() {
		return m_pref_book;
	}

	public void setM_pref_book(String m_pref_book) {
		this.m_pref_book = m_pref_book;
	}

	public int getM_age() {
		return m_age;
	}

	public void setM_age(int m_age) {
		this.m_age = m_age;
	}

	public String getM_name() {
		return m_name;
	}

	public void setM_name(String m_name) {
		this.m_name = m_name;
	}

	public String getM_zipcode() {
		return m_zipcode;
	}

	public void setM_zipcode(String m_zipcode) {
		this.m_zipcode = m_zipcode;
	}

	public String getM_addr() {
		return m_addr;
	}

	public void setM_addr(String m_addr) {
		this.m_addr = m_addr;
	}

	public String getM_grade() {
		return m_grade;
	}

	public void setM_grade(String m_grade) {
		this.m_grade = m_grade;
	}
	
	
	
	

}